import React from 'react';

function About() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>About LO Beauty Home</h1>
      <p>
        LO Beauty Home is your trusted destination for high-quality women’s and kids’ fashion, hair, and cosmetics. 
        We blend style, affordability, and authenticity to meet the unique beauty needs of our diverse customers. 
        Our team is passionate about helping you look and feel your best, whether it's with our trendy wigs, 
        vibrant cosmetics, or fashionable outfits for every occasion.
      </p>
    </div>
  );
}

export default About;
